import './App.css';
import { Route, Routes } from 'react-router';
import HomePage from './pages/HomePage';
import WriteReviewPage from './pages/WriteReviewPage';
import ReviewListPage from './pages/ReviewListPage';
import LoginPage from './pages/LoginPage';
import SignUpPage from './pages/SignUpPage';
import SelectedReviewPage from './pages/SelectedReviewPage';

function App() {

  const testMovieInfo = [
    {
      title: "Teenage Mutant Ninja Turtles",
      yearOfMovie: 2022,
      movieDescription: "Shit movie",
      actors: {
        Diego: "John Smith",
        Turtle2: "Joe Mama",
        Turtle3: "Joshua Krap",
        BadGuy1: "Chimpanzee"
      },
      posterImageSrc: "www.google.com",
    }
  ];

  const userInfo = [
    {
      username: "hwane94",
      password: "1234"
    }
  ]


  function api() {
    var express = require('express');
    var app = express();
    var client_id = 'FcL1SkIZxniucFNyhXuC';
    var client_secret = '56rwc8nn1t';
    app.get('/search/blog', function (req, res) {
      var api_url = 'https://openapi.naver.com/v1/search/blog?query=' + encodeURI(req.query.query); // JSON 결과
      var request = require('request');
      var options = {
        url: api_url,
        headers: { 'X-Naver-Client-Id': client_id, 'X-Naver-Client-Secret': client_secret }
      };
      request.get(options, function (error, response, body) {
        if (!error && response.statusCode == 200) {
          res.writeHead(200, { 'Content-Type': 'text/json;charset=utf-8' });
          res.end(body);
        } else {
          res.status(response.statusCode).end();
          console.log('error = ' + response.statusCode);
        }
      });
    });
    app.listen(3000, function () {
      console.log('http://127.0.0.1:3000/search/blog?query=검색어 app listening on port 3000!');
    });
  }

  return (
    <div>
      <Routes>
        {api}
        <Route path='/' element={<HomePage />} />
        <Route path='/writereview' element={<WriteReviewPage />} />
        <Route path='/reviews' element={<ReviewListPage />}></Route>
        <Route path='/signin' element={<LoginPage />}></Route>
        <Route path='/signup' element={<SignUpPage />}></Route>
        <Route path='/selectedreview' element={<SelectedReviewPage />}></Route>
      </Routes>
    </div>
  );
}

export default App;
